{
  
  var face = {
  width : 174, height : 174, bpp : 2,
  transparent : 0,
  buffer : require("heatshrink").decompress(atob(""))
};

var numerals = {
  width : 174, height : 174, bpp : 2,
  transparent : 0,
  buffer : require("heatshrink").decompress(atob(""))
};

var minute = {
  width : 174, height : 174, bpp : 4,
  transparent : 1,
  buffer : require("heatshrink").decompress(atob(""))
};

var hour = {
  width : 174, height : 174, bpp : 2,
  transparent : 1,
  buffer : require("heatshrink").decompress(atob(""))
};


function draw(h,m,s) {
  g.clear();
  const m180 = 2*Math.PI/60;
  const h180 = 2*Math.PI/12;
  g.drawImage(face, 87, 87, {"rotate": (s-15)*m180});
  g.drawImage(numerals);  
  g.drawImage(minute, 87,87, {  "rotate": (m-15)*m180 });
  g.drawImage(hour, 87,87, {  "rotate": (h-3+m/60)*h180 });
}

function tick() {
  var d = new Date();
  var h= d.getHours();
  if (h>12) h = h -12;
  s = d.getSeconds();
  //ss = Date.now() % 1;
  draw(h,d.getMinutes(),s);
  if (Bangle.isBacklightOn()) {setTimeout(tick, 100);}
  else { setTimeout(tick, 1000 * (60-s)); }
}

tick();

Bangle.setUI("clock");
Bangle.on("backlight", tick);

}

